import React from "react";
import "./style.css";

function Nav() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark">
      <span>
        <img
          src="http://icons.iconarchive.com/icons/ampeross/smooth/128/Apple-Books-Border-icon.png"
          alt="App-Name"
        />
        Books 4 Bookworms
      </span>
      <a className="navbar-brand" href="/">
        SEARCH
      </a>
      <a className="navbar-brand" href="/saved">
        SAVED
      </a>
    </nav>
  );
}

export default Nav;
